LongDescription:
Важность хорошего интерфейса переоценить сложно. Если он организован неудобно и нелогично, или переполнен элементами и средствами управления, или не адаптирован под мобильные устройства, или показывает плохие результаты 5-секундного теста, то работать с таким приложением будут только вынужденно. В лучшем случае продуктивность пользователей снизится, в худшем — они вообще будут избегать это приложение. Единое окно для рекрутёров TalentForce полезен для тех рекрутёров, которые ищут кандидатов на открытые вакансии и проводят собеседования. Поэтому при разработке интерфейса мы ориентировались именно на их потребности, а также на общепринятые правила интерфейсостроения:
 - придерживались принципа единого окна, где можно увидеть всю необходимую информацию по кандидатам, чтобы рекрутёры реже обращались к другим вкладкам, окнам или приложениям;
 - старались соблюсти логичность и лаконичность интерфейса. Органы управления и различные информационные блоки должны были находиться там, где их ожидают увидеть пользователи. При этом мы старались не повышать излишне плотность размещения элементов интерфейса.
